create database BISFT

use BISFT
CREATE TABLE InventoryItems (
    ItemID INT PRIMARY KEY IDENTITY(1,1),
    Product VARCHAR(100) NOT NULL,
    Description VARCHAR(255),
    Category VARCHAR(100),
    Supplier VARCHAR(100),
    Quantity INT NOT NULL,
    Availability VARCHAR(50),
    PurchasePrice DECIMAL(10, 2),
    SellingPrice DECIMAL(10, 2),
    ThresholdValue INT,
    ExpiryDate DATE,
    DateAdded DATETIME DEFAULT GETDATE(),
    LastUpdated DATETIME DEFAULT GETDATE()
);

CREATE TABLE Customers (
    CustomerID INT PRIMARY KEY IDENTITY(1,1),
    CustomerName VARCHAR(100) NOT NULL,
    CustomerType VARCHAR(50),
    Phone VARCHAR(20),
    Email VARCHAR(100),
    Address VARCHAR(255),
    AmountPaid DECIMAL(10, 2) DEFAULT 0,
    AmountRemaining DECIMAL(10, 2) DEFAULT 0,
    RegistrationDate DATETIME DEFAULT GETDATE()
);

CREATE TABLE Sales (
    SaleID INT PRIMARY KEY IDENTITY(1,1),
    CustomerName VARCHAR(100) NOT NULL,
    SaleDate DATETIME DEFAULT GETDATE(),
    TotalAmount DECIMAL(10, 2) NOT NULL
);

CREATE TABLE SaleItems (
    SaleItemID INT PRIMARY KEY IDENTITY(1,1),
    SaleID INT NOT NULL,
    ProductName VARCHAR(100) NOT NULL,
    Quantity INT NOT NULL,
    PricePerUnit DECIMAL(10, 2) NOT NULL,
    SellingPrice AS (Quantity * PricePerUnit) PERSISTED,
    FOREIGN KEY (SaleID) REFERENCES Sales(SaleID) ON DELETE CASCADE
);


CREATE TABLE DailySalesForecast (
    ForecastID INT PRIMARY KEY IDENTITY(1,1),
    ForecastDate DATE NOT NULL,
    PredictedSales DECIMAL(10, 2) NOT NULL,
    ModelRunDate DATETIME DEFAULT GETDATE()
);

CREATE TABLE ProductForecastHistory (
    ForecastID INT PRIMARY KEY IDENTITY(1,1),
    ItemId INT NOT NULL,
    ForecastedQuantity FLOAT NOT NULL,
    ForecastDate DATE NOT NULL
);

SELECT i.Product, i.Quantity, pf.ForecastedQuantity, i.ThresholdValue
FROM ProductForecastHistory pf
JOIN InventoryItems i ON pf.ItemId = i.ItemID
WHERE (i.Quantity - pf.ForecastedQuantity) <= i.ThresholdValue;

CREATE TABLE MonthlySalesForecast (
    ForecastMonth VARCHAR(7) PRIMARY KEY,       -- Format: 'YYYY-MM' (e.g., '2025-05')
    PredictedSales DECIMAL(18, 2) NOT NULL,     -- e.g., 154000.00
    ForecastGeneratedAt DATETIME DEFAULT GETDATE()  -- Optional: track when it was generated
);

